import React from 'react';

const Nav = (props) => {
    return (
        <nav className="nav">
            <div className="nav-container">
                <div className="nav-logo">
                    <a href='#'>MY Logo</a>
                </div>
                <div id="nav-mainListDiv" className="nav-main-list">
                    <ul className="navLinks">
                        <li><a href="#">Login</a></li>
                        <li><a href="#">SignUp</a></li>
                    </ul>
                </div>
            </div>
        </nav>
    );
}

export default Nav;
